import './PaginaPrincipal.css';
import logoImage from './logofoto.png'; 
import fotoini from './fotoinicio.png';
import jsfoto from './jsfoto.png';
import divini from './pythonfoto.png';
import javafoto from './javafoto.png';
import reactnative from './Reactnativefoto.png';
import reactjs from './Reactjsfoto.png';
import phpfoto from './phpfoto.png';
import timedata from './fototimedata.png';
import { useState } from 'react';

// Definir NavBar fuera de PaginaPrincipal
const NavBar = () => {
    const [menuVisible, setMenuVisible] = useState(false);

    const toggleMenu = () => {
        setMenuVisible(!menuVisible);
    };

    return (
        <div className="navbar">
            <div className="donaciones" onClick={toggleMenu}>Donaciones</div>
            <div className="sobre-nosotros">Sobre nosotros</div>
            <div className="comentarios">Comentarios</div>
            {menuVisible && (
                <div className="dropdown-menu">
                    {/* Aquí puedes agregar los elementos del menú */}
                </div>
            )}
        </div>
    );
};

const PaginaPrincipal = () => {
    return (
        <div className="paginaprincipal">
            <img className="logofoto-icon" alt="Logo" src={logoImage} />
            <NavBar /> {/* Llamar a NavBar aquí */}
            <div className="navbar1">
                <div className="chat-bot">Chat bot</div>
                <div className="subir-reto">Subir reto</div>
                <div className="a">
                    <div className="crear-reto">+ Crear reto</div>
                </div>
            </div>
            <img className="fotoinicio-icon" alt="" src={fotoini} />
            {/* Continúa con el resto de tu código */}
            <img className="timedata-icon" alt="Logo" src={timedata} />
            <div className="timedata-text1">Aprende de </div>
            <div className="timedata-text2">una manera </div>
            <div className="timedata-text3">mas facil con </div>
            <div className="retos-creados">Retos creados</div>
            <div className="comentarios1">Comentarios</div>
            <div className="nuestros-lenguajes-de">Nuestros lenguajes de programación</div>
            <img className="logofoto-icon" alt="Logo" src={logoImage} />
            <img className="phpfoto-icon" alt="" src={phpfoto} />
            <img className="reactnativefoto-icon" alt="" src={reactnative} />
            <img className="reactjsfoto-icon" alt="" src={reactjs} />
            <div className="comentario3">
                <img className="foto-comentario3-icon" alt="" src="foto comentario3.png" />
                <div className="me-encanta-compartir">Me encanta compartir lo que sé con los demás, y me llena de satisfacción saber que estoy contribuyendo a algo positivo.</div>
                <div className="eleanor-pena">Eleanor Pena</div>
            </div>
            <div className="comentario2">
                <img className="foto-comentario3-icon" alt="" src="foto comentario 2.png" />
                <div className="me-encanta-compartir">Me gusta mucho dar mi conocimiento a los demás y me emciona estar ayudando a una buena causa</div>
                <div className="eleanor-pena">Cody Fisher</div>
            </div>
            <div className="comentario1">
                <img className="foto-comentario3-icon" alt="" src="foto comentario 1.png" />
                <div className="me-encanta-compartir">Disfruto mucho transmitir mis conocimientos y me emociona formar parte de una causa que hace la diferencia.</div>
                <div className="eleanor-pena">Leslie Alexander</div>
            </div>
            <img className="user-icon" alt="" src="user.svg" />
            <div className="nav-bar">
                <div className="keylan-c">Keylan C</div>
                <img className="desplegar-cuenta-icon" alt="" src="desplegar cuenta.svg" />
            </div>
        </div>
    );
};

export default PaginaPrincipal;
